import React from 'react';

function UsersList(props) {
  let userElements;
  if (props.users.length) {
    userElements = props.users.map((user, idx) => (<li key={idx}>{user.name}</li>));
  } else {
    userElements = ''
  }
  return (
    <ul>
      {userElements}
    </ul>
  );
}

export default UsersList;
